export const hoverNav = status => {
    return {
        type: 'HOVER_NAV',
        payload: status
    };
};

export const headerAccepted = bool => {
    return {
        type: 'HOVER_SHOULD_SHOW',
        payload: bool
    };
};

export const navChangeStyle = bool => {
    return {
        type: 'CHANGE_NAV_STYLE',
        payload: bool
    };
};

export const enterMainPage = () => {
    return {
        type: 'ON_MAIN'
    };
};

export const enterAboutPage = () => {
    return {
        type: 'ON_ABOUT'
    };
};

export const enterLocationSubpage = () => {
    return {
        type: 'ON_LOCATION'
    };
};

export const enterStaffSubpage = () => {
    return {
        type: 'ON_STAFF'
    };
};

export const enterOfferPage = () => {
    return {
        type: 'ON_OFFER'
    };
};

export const leavePage = () => {
    return {
        type: 'OFF_PAGE'
    };
};

export const twoPersonRoomDetails = () => {
    return {
        type: 'TWO_P_ROOM_CHOOSED'
    };
};
export const fourPersonHouse = () => {
    return {
        type: 'FOUR_P_H_CHOOSED'
    };
};
